import React, { useState } from 'react';
import axios from 'axios';

const MarksForm = () => {
  const [telugu, setTelugu] = useState('');
  const [hindi, setHindi] = useState('');
  const [english, setEnglish] = useState('');
  const [maths, setMaths] = useState('');
  const [science, setScience] = useState('');
  const [social, setSocial] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:8080/addMarks', {
        telugu: parseInt(telugu),
        hindi: parseInt(hindi),
        english: parseInt(english),
        maths: parseInt(maths),
        science: parseInt(science),
        social: parseInt(social),
      });

      console.log(response.data);
      // Handle success or redirect if needed
    } catch (error) {
      console.error(error);
      // Handle error
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <label htmlFor="telugu">Telugu:</label>
      <input
        type="text"
        id="telugu"
        value={telugu}
        onChange={(e) => setTelugu(e.target.value)}
        required
      />

      <label htmlFor="hindi">Hindi:</label>
      <input
        type="text"
        id="hindi"
        value={hindi}
        onChange={(e) => setHindi(e.target.value)}
        required
      />

      <label htmlFor="english">English:</label>
      <input
        type="text"
        id="english"
        value={english}
        onChange={(e) => setEnglish(e.target.value)}
        required
      />

      <label htmlFor="maths">Maths:</label>
      <input
        type="text"
        id="maths"
        value={maths}
        onChange={(e) => setMaths(e.target.value)}
        required
      />

      <label htmlFor="science">Science:</label>
      <input
        type="text"
        id="science"
        value={science}
        onChange={(e) => setScience(e.target.value)}
        required
      />

      <label htmlFor="social">Social:</label>
      <input
        type="text"
        id="social"
        value={social}
        onChange={(e) => setSocial(e.target.value)}
        required
      />

      <button type="submit">Submit</button>
    </form>
  );
};

export default MarksForm;
